import { useRouter } from "next/router";
import Splash from "../components/Splash";

const Page = () => {
  const router = useRouter();
  const [isLoading, setLoading] = useState(true);
  useEffect(() => {
    setLoading(false);
  });
  console.log(isLoading);
  return <h2>hello</h2>;
};

export default Page;
